      ret = rtx3GPPDecVarAltDetmnt(pctxt, &ui, altDetmntTab, sizeof(altDetmntTab)/sizeof(OS3GPPAltDecodeTabEntry));
      if (ret < 0) return LOG_RTERR (pctxt, ret);
